import React from 'react'
import animals from '../photos/animals.jpg';

const styles = {
    backgroundImage: `url(animals.jpg)`,
    height: '100vh',
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    flexDirection: 'column',
    color: '#fff',
  };

function Homepage() {
  return (
    <div style={styles}>
        {/* <img src={animals} className="App-logo" alt="logo" /> */}
        <h1 className='display-1 text-center'>AniHelp</h1>
        <button className='btn btn-primary mr-3'>Login</button>
        <button className='btn btn-primary mr-3'>Sign up</button>
    </div>
  )
}
export default Homepage


